/** *	TestTab navigator * *	@param tabtitle string ***/ServiceClient.jquery.navigator.TestTab = function(config){	return [{		service : 'paint',		view : 'tabui',		template : 'test',		renderer : 'tplui',		params : {			tabtitle : config.tabtitle || 'Testing',			isclosable : true,			autoload : false,			loadurl : config.loadurl || 'data.json.php',			loadparams : {}		}	}];}